// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IERC20 {
    function transfer(address to, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function allowance(address owner, address spender) external view returns (uint256);
}

interface IHederaTokenService {
    function associateToken(address account, address token) external returns (int64);
    function transferToken(address token, address from, address to, int64 amount) external returns (int64);
    function isTokenAssociated(address account, address token) external view returns (bool);
    function allowance(address token, address owner, address spender) external view returns (int64);
    function balanceOf(address token, address account) external view returns (int64);
}

contract LynxMinter {
    address public owner;
    uint256 private _status;
    uint256 private constant _NOT_ENTERED = 1;
    uint256 private constant _ENTERED = 2;
    address private constant HTS_PRECOMPILE = address(0x0000000000000000000000000000000000000360);
    address private mockHtsPrecompile;

    // Token addresses (Hedera format)
    address public lynxToken;
    address public sauceToken;
    address public clxyToken;

    uint256 public constant RATIO_PRECISION = 1e8; // 8 decimals to match LYNX

    event LynxMinted(
        address indexed user,
        uint256 hbarAmount,
        uint256 sauceAmount,
        uint256 clxyAmount,
        uint256 lynxMinted,
        uint256 nonce
    );

    event LynxBurned(
        address indexed user,
        uint256 hbarAmount,
        uint256 sauceAmount,
        uint256 clxyAmount,
        uint256 lynxBurned,
        uint256 burnNonce
    );

    event DebugMint(string message, uint256 value1, uint256 value2);
    event DebugConfirmMint(string message, address sender, address owner, uint256 nonce, bool isPending);
    event DebugOwner(string message, address msgSender, address contractOwner);
    event DebugBurn(string message, uint256 amount, uint256 nonce);
    event TokenAssociationAttempted(address token, int64 responseCode);
    event TokenAssociationDebug(string message, address token);

    // Add tracking for total deposits
    uint256 public totalHbarDeposited;
    uint256 public totalSauceDeposited;
    uint256 public totalClxyDeposited;
    uint256 public totalLynxMinted;
    uint256 public mintNonce;
    uint256 public burnNonce;

    // Mapping to track pending mints and burns
    mapping(uint256 => bool) public pendingMints;
    mapping(uint256 => bool) public pendingBurns;
    mapping(uint256 => address) public burnRequester;
    mapping(uint256 => uint256) public burnAmounts;

    error ReentrancyGuardReentrantCall();
    error OnlyOwner();
    error TokenNotAssociated();
    error TransferFailed();
    error InsufficientAllowance();
    error InsufficientBalance();
    error BurnNotPending();
    error InsufficientHBAR();
    error InsufficientSauceAllowance();
    error InsufficientClxyAllowance();
    error InsufficientSauceBalance();
    error InsufficientClxyBalance();
    error InsufficientLynxBalance();
    error InsufficientContractBalance();
    error InvalidAmount();
    error InvalidBurnRequester();
    error AmountMismatch();

    constructor(
        address _lynxToken,
        address _sauceToken,
        address _clxyToken
    ) {
        require(_lynxToken != address(0), "LYNX token address cannot be zero");
        require(_sauceToken != address(0), "SAUCE token address cannot be zero");
        require(_clxyToken != address(0), "CLXY token address cannot be zero");

        owner = msg.sender;
        _status = _NOT_ENTERED;
        lynxToken = _lynxToken;
        sauceToken = _sauceToken;
        clxyToken = _clxyToken;
        mintNonce = 0;
        burnNonce = 0;
    }

    modifier onlyOwner() {
        if (msg.sender != owner) revert OnlyOwner();
        _;
    }

    modifier nonReentrant() {
        if (_status == _ENTERED) revert ReentrancyGuardReentrantCall();
        _status = _ENTERED;
        _;
        _status = _NOT_ENTERED;
    }

    function setMockHtsPrecompile(address _mockHtsPrecompile) external onlyOwner {
        mockHtsPrecompile = _mockHtsPrecompile;
    }

    function getHtsPrecompile() internal view returns (address) {
        return mockHtsPrecompile != address(0) ? mockHtsPrecompile : HTS_PRECOMPILE;
    }

    function checkUserTokenAssociations(address user) internal view {
        IHederaTokenService hts = IHederaTokenService(getHtsPrecompile());
        if (!hts.isTokenAssociated(user, lynxToken)) revert TokenNotAssociated();
        if (!hts.isTokenAssociated(user, sauceToken)) revert TokenNotAssociated();
        if (!hts.isTokenAssociated(user, clxyToken)) revert TokenNotAssociated();
    }

    function mint(uint256 amount) external payable nonReentrant {
        if (msg.value != amount) revert InsufficientHBAR();

        // Check token associations
        checkUserTokenAssociations(msg.sender);

        // Get HTS instance
        IHederaTokenService hts = IHederaTokenService(getHtsPrecompile());

        // Check allowances using HTS
        int64 sauceAllowance = hts.allowance(sauceToken, msg.sender, address(this));
        if (sauceAllowance < int64(uint64(amount))) revert InsufficientSauceAllowance();

        int64 clxyAllowance = hts.allowance(clxyToken, msg.sender, address(this));
        if (clxyAllowance < int64(uint64(amount))) revert InsufficientClxyAllowance();

        // Check balances using HTS
        int64 sauceBalance = hts.balanceOf(sauceToken, msg.sender);
        if (sauceBalance < int64(uint64(amount))) revert InsufficientSauceBalance();

        int64 clxyBalance = hts.balanceOf(clxyToken, msg.sender);
        if (clxyBalance < int64(uint64(amount))) revert InsufficientClxyBalance();

        // Transfer tokens using HTS
        int64 sauceTransfer = hts.transferToken(sauceToken, msg.sender, address(this), int64(uint64(amount)));
        if (sauceTransfer != 0) revert TransferFailed();

        int64 clxyTransfer = hts.transferToken(clxyToken, msg.sender, address(this), int64(uint64(amount)));
        if (clxyTransfer != 0) revert TransferFailed();

        // Update totals
        totalHbarDeposited += amount;
        totalSauceDeposited += amount;
        totalClxyDeposited += amount;
        totalLynxMinted += amount;

        // Emit event for MinterService to handle LYNX minting
        emit LynxMinted(msg.sender, amount, amount, amount, amount, mintNonce++);
    }

    function getBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function getMaxMintableAmount() external view returns (uint256) {
        return address(this).balance;
    }

    function withdrawHBAR(uint256 amount) external onlyOwner {
        require(amount <= address(this).balance, "Insufficient HBAR balance");
        payable(owner).transfer(amount);
    }

    // Add functions to withdraw SAUCE and CLXY in case of emergency
    function withdrawSAUCE(uint256 amount) external onlyOwner {
        require(amount <= IERC20(sauceToken).balanceOf(address(this)), "Insufficient SAUCE balance");
        require(IERC20(sauceToken).transfer(owner, amount), "SAUCE transfer failed");
    }

    function withdrawCLXY(uint256 amount) external onlyOwner {
        require(amount <= IERC20(clxyToken).balanceOf(address(this)), "Insufficient CLXY balance");
        require(IERC20(clxyToken).transfer(owner, amount), "CLXY transfer failed");
    }

    // Function to associate tokens with the contract
    function associateTokens() external onlyOwner {
        IHederaTokenService hts = IHederaTokenService(getHtsPrecompile());

        // Try to associate LYNX token
        int64 lynxResponse = hts.associateToken(address(this), lynxToken);
        require(lynxResponse == 0 || lynxResponse == 200 || lynxResponse == 197, "LYNX association failed");

        // Try to associate SAUCE token
        int64 sauceResponse = hts.associateToken(address(this), sauceToken);
        require(sauceResponse == 0 || sauceResponse == 200 || sauceResponse == 197, "SAUCE association failed");

        // Try to associate CLXY token
        int64 clxyResponse = hts.associateToken(address(this), clxyToken);
        require(clxyResponse == 0 || clxyResponse == 200 || clxyResponse == 197, "CLXY association failed");
    }

    // New function to initiate burning LYNX tokens
    function burn(uint256 amount) external nonReentrant {
        if (amount == 0) revert InvalidAmount();

        // Get HTS instance
        IHederaTokenService hts = IHederaTokenService(getHtsPrecompile());

        // Check LYNX balance using HTS
        int64 lynxBalance = hts.balanceOf(lynxToken, msg.sender);
        if (lynxBalance < int64(uint64(amount))) revert InsufficientLynxBalance();

        // Check contract has enough tokens to return
        int64 contractSauceBalance = hts.balanceOf(sauceToken, address(this));
        if (contractSauceBalance < int64(uint64(amount))) revert InsufficientContractBalance();

        int64 contractClxyBalance = hts.balanceOf(clxyToken, address(this));
        if (contractClxyBalance < int64(uint64(amount))) revert InsufficientContractBalance();

        // Transfer LYNX tokens from user to contract using HTS
        int64 lynxTransfer = hts.transferToken(lynxToken, msg.sender, address(this), int64(uint64(amount)));
        if (lynxTransfer != 0) revert TransferFailed();

        // Increment burn nonce
        uint256 currentNonce = burnNonce;
        burnNonce = currentNonce + 1;

        // Mark burn as pending and store requester and amount
        pendingBurns[currentNonce] = true;
        burnRequester[currentNonce] = msg.sender;
        burnAmounts[currentNonce] = amount;

        emit DebugBurn("Burn initiated", amount, currentNonce);
    }

    // New function to confirm burning LYNX tokens and return assets
    function confirmBurn(uint256 nonce, uint256 amount) external onlyOwner nonReentrant {
        if (!pendingBurns[nonce]) revert BurnNotPending();

        // Get the user who requested the burn
        address user = burnRequester[nonce];
        if (user == address(0)) revert InvalidBurnRequester();

        // Verify amount matches the requested burn amount
        if (burnAmounts[nonce] != amount) revert AmountMismatch();

        // Get HTS instance
        IHederaTokenService hts = IHederaTokenService(getHtsPrecompile());

        // Clear pending burn
        pendingBurns[nonce] = false;

        // Update totals
        totalHbarDeposited -= amount;
        totalSauceDeposited -= amount;
        totalClxyDeposited -= amount;
        totalLynxMinted -= amount;

        // Transfer HBAR back to user
        payable(user).transfer(amount);

        // Transfer SAUCE and CLXY tokens back to user using HTS
        int64 sauceTransfer = hts.transferToken(sauceToken, address(this), user, int64(uint64(amount)));
        if (sauceTransfer != 0) revert TransferFailed();

        int64 clxyTransfer = hts.transferToken(clxyToken, address(this), user, int64(uint64(amount)));
        if (clxyTransfer != 0) revert TransferFailed();

        emit LynxBurned(user, amount, amount, amount, amount, nonce);
    }
}

